const api_url = "https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan"

async function sendRequest(json) {
    const res = await fetch(api_url, {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify(
            json
        )
    })
    
    const data = await res.json()
    return (
        <h1>{ data }</h1>
    )
}

export default sendRequest
